('18833853-e2fb-4fbc-a6db-c7b729aba3b2', '1820774BCC', '1820774BCC', 'Retirado', '2020-03-21', 'Má conduta de líder, lidou com uma situação de forma desnecessariamente agressiva com os membros, abalando moralmente os mesmo e desmotivando com relação ao projeto, além de não vinculação e abertura real com os membros da sua equipe, o que resultou em uma péssima comunicação entre os mesmos', '2020-03-21 00:00:00', '2020-03-21 00:00:00'),
