('6676766f-3f33-4e70-8cde-61225511e4c4', '1724386GAUT', '1724274GAUT', 'Retirado', '2020-04-14', 'Por solicitação própria devido a frequentes ausências relacionado a seu cargo, falta de comunicação e comprometimento com a mecânica mesmo após diversas conversas com o mesmo.', '2020-04-14 00:00:00', '2020-04-14 00:00:00'),
('f5b7a185-3e1f-4684-9c35-1caf63419b25', '1724386GAUT', '1911976BCC', 'Retirado', '2020-04-15', 'Devido a frequentes ausências relacionado ao seu cargo, falta de comprometimento e cobrança com a eletrônica que acarretou em diversos atrasos com pesquisas e projetos da equipe. Sendo que o problema persistiu mesmo após conversas com o mesmo.', '2020-04-15 00:00:00', '2020-04-15 00:00:00'),
('83b22746-7603-419f-93b5-dd4d79f190a2', '1911979BCC', '1911926GADM', 'Retirado', '2020-04-16', '1. No dia 13/04, pediu um relatório com um prazo incoerente, exigindo da equipe para ser entregue no dia seguinte, assim não seguindo o prazo estipulado de pesquisa, pelo próprio, no Trello. 2. Tratou a equipe de forma desrespeitosa.3. Supôs frente a todos os membros do grupo de programação que eu teria impedido ele de participar de uma reunião da equipe para a confecção do código. Sendo que no dia da reunião eu disse, no privado do wpp, que não era uma reunião de decisões, e sim uma reunião para realizar o novo código, mas que se ele quisesse ele poderia acompanhar. Outrossim, instantes depois o mesmo disse que não o impedi de participar da reunião, após eu ter dito que ele estava mentindo.4. Não fez a ata da reunião de decisões de projeto geral da equipe, reunião com todos os subsistemas. 5. Ao receber o relatório, não leu o relatório e reclamou com a equipe de erros.', '2020-04-16 00:00:00', '2020-04-16 00:00:00'),
